// 初始化数据
(function () {
  let devStore = localStorage.getItem("devStore");
  if (!devStore) return;
  devStore = JSON.parse(devStore);
  devStore.forEach((item) => {
    if (!item.enable) return;
    try {
      eval(`${item.fn}('${item.fieldName}','${item.selected}')`);
    } catch (e) {
      console.error(e);
    }
  });
})();
// 准备JSON5,Vue,ElementPlus模块链接
let JSON5Link = "https://unpkg.com/json5@2.2.3/dist/index.mjs";
let VueLink = "https://unpkg.com/vue@3.2.47/dist/vue.esm-browser.prod.js";
let ElementPlusLink =
  "https://unpkg.com/element-plus@2.2.30/dist/index.full.min.mjs";
let JSON5Promise = import(JSON5Link);
let VuePromise = import(VueLink);
let ElementPlusPromise = fetch(ElementPlusLink)
  .then(async (resp) => resp.text())
  .then((text) => {
    text = text.replace("vue", VueLink);
    return import(
      URL.createObjectURL(new Blob([text], { type: "application/javascript" }))
    );
  });

// 插入样式
function insertStyle(href) {
  let link = document.createElement("link");
  link.setAttribute("rel", "stylesheet");
  link.href = href;
  document.head.appendChild(link);
}
insertStyle(URL.createObjectURL(new Blob([elementPlusCss])));
// 导入模块
Promise.all([JSON5Promise, VuePromise, ElementPlusPromise]).then(
  ([
    { default: JSON5 },
    { createApp },
    { default: ElementPlus, ElMessage },
  ]) => {
    window.JSON5 = JSON5;
    const el = document.createElement("div");
    el.innerHTML = /* HTML */ `<el-config-provider namespace="dev">
      <el-drawer v-model="drawerVisible" title="简易开发者工具" size="400" style="font-size: var(--dev-font-size-base);">
        <el-button @click="storeString=devStoreExample">配置案例</el-button>
        <el-button @click="update">保存设置</el-button>
        <el-button @click="reload">刷新页面</el-button>
        <div
          v-for="(config,index) in devStore"
          :key="config.fieldName"
          style="display: flex; align-items: center;justify-content: space-between;"
        >
          {{config.fieldName}}
          <div>
            <el-select v-model="config.selected" style="margin: 5px">
              <el-option
                v-for="item in config.content"
                :key="item.text"
                :label="item.name"
                :value="item.text"
              />
            </el-select>
            <el-switch v-model="config.enable" />
          </div>
        </div>
        <el-collapse>
          <el-collapse-item title="开发者设置">
            <el-input v-model="storeString" type="textarea" autosize></el-input>
          </el-collapse-item>
        </el-collapse>
      </el-drawer>
    </el-config-provider>`;
    document.documentElement.appendChild(el);
    createApp({
      data() {
        return {
          drawerVisible: false,
          devStore: [],
          devStoreExample: JSON.stringify(
            [
              {
                fieldName: "backend",
                fn: "localStorage.setItem",
                selected: "http://localhost:8080",
                enable: false,
                content: [
                  { name: "开发", text: "http://localhost:8080" },
                  { name: "生产", text: "http://localhost:8090" },
                ],
              },
            ],
            null,
            2
          ),
          storeString: "",
        };
      },
      methods: {
        init() {
          let devStoreString = localStorage.getItem("devStore");
          this.devStore = devStoreString ? JSON5.parse(devStoreString) : [];
        },
        update() {
          this.devStore = JSON5.parse(this.storeString);
          ElMessage({
            message: "环境配置完成",
            type: "success",
          });
        },
        reload() {
          window.location.reload();
        },
      },
      mounted() {
        this.init();
        addEventListener("keyup", (e) => {
          if (e.shiftKey && e.code === "KeyD") {
            this.drawerVisible = !this.drawerVisible;
          }
          if (this.drawerVisible && e.ctrlKey && e.code === "Enter") {
            this.update();
          }
        });
      },
      watch: {
        devStore: {
          deep: true,
          handler(newValue) {
            this.storeString = JSON5.stringify(newValue, null, 2);
            localStorage.setItem("devStore", JSON.stringify(this.devStore));
          },
        },
      },
    })
      .use(ElementPlus)
      .mount(el);
  }
);
